import Link from "next/link";
import styled from "styled-components";
import { ButtonPrimary, ButtonSecondary } from "../Button/Button";
import { Flex } from "../Flex/Flex";
import { Text } from "../Text/Text";

const NavbarOption = styled.a`
  text-decoration: none;
  border: none;
  padding: 10px 0px;
  min-width: 50px;
  text-align: center;
  border-bottom: 2px solid transparent;
  font-weight: bold;
  line-height: 18px;
  transition: all 350ms;
  max-height: 18px;

  &:hover {
    border-bottom: 2px solid red;
  }
`;

const Navbar = () => (
  <Flex w={1} justifyContent="start" border="1px solid">
    <Flex minWidth={200} border="1px solid">
      <Text>Elefante</Text>
    </Flex>
    <Flex alignItems="center" border="1px solid">
      <Flex px={3}>
        <Link href="/">
          <NavbarOption>Home</NavbarOption>
        </Link>
      </Flex>
      <Flex px={3}>
        <Link href="/recursos">
          <NavbarOption>Recursos</NavbarOption>
        </Link>
      </Flex>
      <Flex px={3}>
        <Link href="/precos">
          <NavbarOption>Pre√ßos</NavbarOption>
        </Link>
      </Flex>
      <Flex px={3}>
        <Link href="/about">
          <NavbarOption>Ajuda</NavbarOption>
        </Link>
      </Flex>
      <Flex>
        <ButtonPrimary mx={2}>Login</ButtonPrimary>
        <ButtonSecondary mx={2}>Cadastre-se</ButtonSecondary>
      </Flex>
    </Flex>
  </Flex>
);

export default Navbar;
